                <div className="tabs">
                  <span className="tabs-count">{item.score}</span>
                  <br />
                  votes
                </div>
              </Col>
              <Col sm={1}>
                <div className="tabs">
                  <span className="tabs-count">{item.answer_count}</span>
                  <br />
                  answers
                </div>
              </Col>
              <Col sm={1}>
                <div className="tabs">
                  <span className="tabs-count">{item.view_count}</span>
                  <br />
                  views
                </div>
              </Col>
              <Col sm={9}>
                <a href={item.link} className="title">
                  {item.title}
                </a>
                <br />
                <p>
                  {item.tags.map((tag, i) => {
                    return (
